SELECT name, category FROM Websites WHERE website_id IN (
    SELECT DISTINCT website_id from Ad_Placements WHERE campaign_id IN (
        SELECT campaign_id from Campaigns WHERE budget > 3500000 AND status = 'active' AND campaign_id IN (
            SELECT campaign_id from Targeting_Options WHERE targeting_type = 'interest' AND option_value = 'Art'
        )
    )
);

SELECT Creatives.name, Creatives.type FROM Creatives
JOIN Campaigns ON Creatives.campaign_id = Campaigns.campaign_id 
WHERE Campaigns.budget > 90000000 AND Creatives.updated_at > DATE_SUB(CURDATE(), INTERVAL 1800 DAY);

SELECT name, type 
FROM Creatives 
WHERE campaign_id IN (SELECT campaign_id FROM Campaigns WHERE budget > 20000000000 AND DATEDIFF(day, updated_at, GETDATE()) <= 20000);

SELECT SUM(orders.total_price) AS total_revenue
FROM orders 
WHERE date_placed BETWEEN DATE_SUB(CURDATE(), INTERVAL 1 QUARTER) AND CURDATE();

SELECT country_id, COUNT(*) as total_elections 
FROM Election 
GROUP BY country_id;

SELECT strftime('%m', rental_start_date) as month, COUNT(rental_id) as num_rentals 
FROM EquipmentRentals 
GROUP BY month;

SELECT Users.username 
FROM Users 
WHERE NOT EXISTS (SELECT WorkoutPlans.plan_id FROM WorkoutPlans WHERE is_available = 1 AND NOT EXISTS (SELECT Enrollments.plan_id FROM Enrollments WHERE Enrollments.user_id = Users.user_id AND Enrollments.plan_id = WorkoutPlans.plan_id));

SELECT MONTH(rental_start_date) as month, COUNT(*) as number_of_rentals 
FROM EquipmentRentals 
GROUP BY MONTH(rental_start_date);

SELECT user_id FROM Enrollments 
WHERE class_id IN (
    SELECT class_id FROM Classes 
    WHERE category_id IN (
        SELECT category_id FROM Categories
    ) AND class_date BETWEEN DATEADD(month, -1, GETDATE()) AND GETDATE()
)
GROUP BY user_id
HAVING COUNT(DISTINCT category_id) = (SELECT COUNT(*) FROM Categories);

SELECT Employee_Name FROM Employee WHERE Employee_ID IN (
    SELECT Employee_ID FROM Time_Entry WHERE Task_ID IN (
        SELECT Task_ID FROM Task WHERE Project_ID IN (
            SELECT Project_ID FROM Project WHERE Project_Name LIKE '%data analysis%'
        )
    )
) AND Employee_ID NOT IN (
    SELECT Employee_ID FROM Leave WHERE (Leave_Start_Date BETWEEN Project_Start_Date AND Project_End_Date) OR (Leave_End_Date BETWEEN Project_Start_Date AND Project_End_Date)
);
